@P_Fiala Když jsme teď s Talibanem prohráli válku, máme 2 možnosti: 1. Izolovat ho a eskalovat teroristické nebezpečí.
2. Jednat s ním a držet ho v mantinelech civilizace, protože on teď zoufale potřebuje mezinárodní respekt, za který je ochoten k ústupkům. 
Vyměň správce účtu, Petře.

